import React from 'react';


const Navbar = () => {
    return (
        <nav className="navbar bg-purple mb-5">
           <div className="container">
               <div className="navbar-brand text-white">
                   Chatomista
               </div>
            </div>
        </nav>
    )
}

export default Navbar
